import React, { useState } from 'react'
// import './Header.css'
import styled from 'styled-components'
import BurgerButton from '../Home/BurgerButton/BurgerButton';



const Header = () => {

    const [clicked, setClicked] = useState(false)
    return (

        <header className='header'>
            <Navbar>
                <div>
                    <a href="/">
                        <img className='logo' src="/Assets/logo.png" alt="logo" />
                    </a>
                </div>
                <ul className='links '>
                    <a href='/'>Home</a>
                    <a href='/'>About</a>
                    <a href='/'>Contact</a>
                </ul>
                <div className='burguer'>
                    <BurgerButton />
                </div>
            </Navbar>

        </header>
    );
}

export default Header;

const Navbar = styled.nav`

        height: 100%;
        display: flex;
        align-items: center;
        justify-content: space-between;
        margin: 0;
        border: none;
        /* background-color: rgba(243, 180.1, 90, 0.89); */
        background-color:  rgba(235, 166, 55, 0.733);
    .logo{
        width: 50px;
        padding: 10px;
        margin-left: 10px;
        transition: width .5s;
        :hover{
            width: 60px;
        }
    }

    .links {
        a{
            margin-right: 15px;
            text-decoration: none;
            font-weight: bold;
            font-size: 20px;
            color: inherit;
            border-radius: 12px;
            transition: .5s; 

           :hover{
                background-color: black ;
                color: aliceblue;
                padding: 5px;
           }
        }

        @media(max-width: 768px){
                position: absolute;
                top: -1000px;
                right: -1000px;
                margin-left: auto;
                margin-right: auto;
                text-align: center;
        }
    }
    
    .links.active{
        width: 100%;
        display: block;
        position: absolute;
        margin-left: auto;
        margin-right: auto;
        top: 15%;
        left: 15%;
        right: 0;
        text-align: center;
        a{
            color: white;
            display: block;
            margin-bottom: 1rem;
        }
    }

   .burguer{
    @media(min-width: 768px){
        display: none;
    }
    
   }
`
